import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <DragableDiv></DragableDiv>
      </header>
    </div>
  );
}
class DragableDiv extends React.Component {
  DragableDiv(content) {
    return (
      <div id="dragable_div">
        <div id="mydivheader">asdf</div>
      </div>
    )
  }
}


export default App;
